// src/App.js

import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LandingPage from './pages/LandingPage';
import PropertyPage from './pages/PropertyPage';
import MaintenancePage from './pages/MaintenancePage';
import NotificationPage from './pages/NotificationPage';
import CommunicationPage from './pages/CommunicationPage';
import PaymentPage from './pages/PaymentPage';
import UserPage from './pages/UserPage';
import HomePage from './pages/HomePage';
import SignInPage from './pages/SignInPage';
import PrivacyPage from './pages/PrivacyPage';
import TermsPage from './pages/TermsPage';
import HelpPage from './pages/HelpPage';
import ContactPage from './pages/ContactPage'; // Import ContactPage component

import './App.css';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LandingPage />} />
        <Route path="/homepage" element={<HomePage />} />
        <Route path="/properties" element={<PropertyPage />} />
        <Route path="/maintenance" element={<MaintenancePage />} />
        <Route path="/notifications" element={<NotificationPage />} />
        <Route path="/communications" element={<CommunicationPage />} />
        <Route path="/payments" element={<PaymentPage />} />
        <Route path="/users" element={<UserPage />} />
        <Route path="/contact" element={<ContactPage />} /> {/* Add route for ContactPage */}
        <Route path="/signin" element={<SignInPage />} />
        <Route path="/privacy" element={<PrivacyPage />} /> {/* Privacy Policy route */}
        <Route path="/terms" element={<TermsPage />} /> {/* Terms of Service route */}
        <Route path="/help" element={<HelpPage />} /> {/* Help Center route */}
      </Routes>
    </Router>
  );
}

export default App;
